exports.getItemFromTokenList = (_field, _content, _list) => {
		
		if(_content.search("_") > -1){
			_content = _content.split("_")[0];
		}
		let tokenSubList;
		let index;
		switch (_field) {
			case 'symbol':
				tokenSubList = _list.map( (item) => { return item.symbol });
				index = tokenSubList.indexOf(_content);
			break;
			case 'address':
				tokenSubList = _list.map( (item) => { return item.address });
				index = tokenSubList.indexOf(_content);
			break;
			case 'index':
				tokenSubList = _list.map( (item) => { return item.index });
				index = tokenSubList.indexOf(parseInt(_content));
			break;
			default :
				console.log("Error: "+_field+" not found on the _list")
				return;
			break;
		} 
		if(index === -1){
			console.log("Error: "+_content+" not found on the field "+_field);
			return;
		}
		return _list[index];
	
	
  }

  exports.getInitialTokenSymbol = (_parsedJson) => {
	   let initialTokenSymbol = _parsedJson.route[0].split("_")[0];
	   if(!initialTokenSymbol){
			throw new Error("initial token symbol not found");
	   } 
	   return initialTokenSymbol;
  }

